import { Redirect, Route } from 'react-router-dom'


class ProtectedRoute extends React.Component{


    constructor(props){
        super(props)
        this.state = {...this.props, component: this.props.Component, loggedIn: this.props.loggedIn}
    }

    render(){
        let component
        if(this.state.loggedIn){


            component = <this.state.component {...rest}{...props}/>
        }else{

         component = <Redirect to= '/login'/>

        }

        return(
            {component}
        )

    }
}
